class Solution
{

    /**
     * @param Integer $bottom
     * @param Integer $top
     * @param Integer[] $special
     * @return Integer
     */
    function maxConsecutive($bottom, $top, $special)
    {
        sort($special);
        $first = $special[0] > $bottom ? ($special[0] - $bottom) : 0;
        $end = end($special);
        $last = $end < $top ? ($top - $end) : 0;
        $res = [$first, $last];
        for ($i = 1; $i < count($special); $i++) {
            $res[] = $special[$i] - $special[$i - 1] - 1;
        }
        return max($res);
    }


    function maxConsecutive2($bottom, $top, $special)
    {
        $max = 0;
        $flag = 0;
        $bottom_p = $bottom;
        sort($special);
        for ($i = $bottom; $i <= $top; $i++) {
            if ($this->binary_search($special, $i) != PHP_INT_MAX) {
                $bottom_p = $i + 1;
            } else {
                $max = max($max, $i - $bottom_p);
                $flag = 1;
            }
        }
        return $flag ? $max + 1 : $max;
    }

    function binary_search(&$nums, $target)
    {
        $l = 0;
        $r = count($nums) - 1;
        while ($l <= $r) {
            $mid = intval(($l + $r) / 2);
            $v = $nums[$mid];
            if ($target == $v) {
                return PHP_INT_MAX;
            }
            if ($v > $target) {
                $r = $mid - 1;
            }
            if ($v < $target) {
                $l = $mid + 1;
            }
        }
        return $l;
    }
}

